import React from "react";

interface Header3Props {
  title: string
  alignment?: string
  padding?: boolean
}

export const Header3 = (props: Header3Props) => {
  const { title, alignment, padding } = props;

  return (
    <header className={
      `${alignment === 'end'
        ? 'pr-4 md:pr-20 xl:pr-40'  
        : 'pl-4 md:pl-20 xl:pl-40' && !padding && 'pr-4' }
      justify-${alignment ? alignment : 'center'}
      flex w-full py-4 text-md xl:text-lg font-bold items-center border-b-2  bg-white`
    }>
      <div className="flex justify-center items-center h-10">
        <p className='uppercase text-center'>
          {title}
        </p>
      </div>
    </header>
  )
}
